import React from 'react';

class Photo extends React.Component {


  render() {
    return (
     <div>
      <img src={props.img_url} alt={all.location} />
      <p>Location:<br />{all.location}</p>
      <p>Description:<br /> {all.description}</p>
    </div>
    );
  };
};
export default Photo;
